import React from 'react';
import { Jumbotron, Button } from 'reactstrap';

export const Heading = (props) => {
  return (
    <div>
      <Jumbotron>
        <h1 className="display-3">Hello, world!</h1>
        <p className="lead">This is a simple earthqauke data dashboard for last month.</p>
        <hr className="my-2" />
        <p>
          This Dashboard uses data given by earthquake.usgs.gov and display in tabular form.<br/><br/>
            1. A number of random queries (up to 1000 queries of random tuples in
            the dataset)<br/>
            2. A restricted set of queries, similar to previous (1.) but where selection is
            restricted (ie only occurring in CA, or within N less than 100 km of a specified
            lat,long location.<br/>
            Or: a time range, or a magnitude range.<br/>
            3. Measure time expended to perform these queries.<br/>
            4. Show results. <br/>
        </p>
        <p className="lead">
          <Button 
          color="primary"
          onClick={props.onClick}
          >Learn More</Button>
        </p>
      </Jumbotron>
    </div>
  );
};
